static const char *kUnknownCipher = "(NONE)";

size_t SSL_get_all_cipher_names(const char **out, size_t max_out) {

  size_t cipherSize = (sizeof(kCiphers) / sizeof(kCiphers[0]));
   if(max_out != 0) {
     *out++ = kUnknownCipher;
     for(int i = 0; i < cipherSize; i++) {
        *out++ = kCiphers[i];
     }
   }
   return 1+cipherSize;
}
